sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
gs.info(inputs.flow)
gs.info(JSON.stringify(inputs.flow))


var flow;
if(!inputs.flow.res){
     flow=JSON.parse(inputs.flow);
}
else{
    flow=inputs.flow;
   
}

 flow.res.push(inputs.cur)
outputs.res=flow;
})(inputs, outputs);

